Loop contracts are used to specify invariants for loops for the sake of extending Kani's bounded proofs to unbounded proofs . A loop invariant is an expression that holds upon entering a loop and after every execution of the loop body. Loop contracts are composed of one or more loop invariants as well as optional loop_modifies attributes. It captures something that does not change about every step of the loop. It is worth revisiting the discussion about bounded proof and loop unwinding . In short, bounds on the number of times Kani unwinds loops also bound the size of inputs, and hence result in a bounded proof. Loop contracts are used to abstract out loops as non-loop blocks to avoid loop unwinding, and hence remove the bounds on the inputs. Consider the following example: fn simple_loop() { let mut x: u64 = kani::any_where(|i| *i >= 1); while x > 1 { x = x - 1; } assert!(x == 1);
} In this program, the loop repeatedly decrements x until it equals 1. Because we haven't specified an upper bound for x, to verify this function, Kani needs to unwind the loop for u64::MAX iterations, which is intractable. Loop contracts allow us to abstract the loop behavior, significantly reducing the verification cost. With loop contracts, we can specify the loop’s behavior using invariants. For example: #![feature(stmt_expr_attributes)]
#![feature(proc_macro_hygiene)] fn simple_loop_with_loop_contracts() { let mut x: u64 = kani::any_where(|i| *i >= 1); #[kani::loop_invariant(x >= 1)] while x > 1 { x = x - 1; } assert!(x == 1);
} Here, the loop invariant #[kani::loop_invariant(x >= 1)] specifies that the condition x >= 1 must hold true at the start of each iteration before the loop guard is checked. Once Kani verifies that the loop invariant is inductive, it will use the invariant to abstract the loop and avoid unwinding. Now let's run the proof with loop contracts through kani: kani simple_loop_with_loop_contracts.rs -Z loop-contracts The output reported by Kani on the example will be ... Check 10: simple_loop_with_loop_contracts.loop_invariant_base.1 - Status: SUCCESS - Description: "Check invariant before entry for loop simple_loop_with_loop_contracts.0" - Location: simple_while_loop.rs:15:5 in function simple_loop_with_loop_contracts Check 11: simple_loop_with_loop_contracts.loop_assigns.1 - Status: SUCCESS - Description: "Check assigns clause inclusion for loop simple_loop_with_loop_contracts.0" - Location: simple_while_loop.rs:15:5 in function simple_loop_with_loop_contracts Check 13: simple_loop_with_loop_contracts.assigns.1 - Status: SUCCESS - Description: "Check that x is assignable" - Location: simple_while_loop.rs:17:9 in function simple_loop_with_loop_contracts Check 14: simple_loop_with_loop_contracts.loop_invariant_step.1 - Status: SUCCESS - Description: "Check invariant after step for loop simple_loop_with_loop_contracts.0" - Location: simple_while_loop.rs:15:5 in function simple_loop_with_loop_contracts Check 15: simple_loop_with_loop_contracts.loop_invariant_step.2 - Status: SUCCESS - Description: "Check invariant after step for loop simple_loop_with_loop_contracts.0" - Location: simple_while_loop.rs:15:5 in function simple_loop_with_loop_contracts ... SUMMARY: ** 0 of 99 failed VERIFICATION:- SUCCESSFUL
