We allow users to manually specified the loop_modifies clauses for memory allocated addresses which can be modified inside the loop body. The concept is very similar to the __CPROVER_assigns clause of CBMC (https://diffblue.github.io/cbmc/contracts-assigns.html). However, in Kani, the CBMC target is replaced by three Rust types which can be used in the loop_modifies clauses: RawPtr: We don't allow variable names as targets. Users must use pointers to them instead, which also allows checking modification using borrowed references and aliases. #[kani::proof]
fn main() { let mut i = 0; #[kani::loop_invariant(i <= 20)] #[kani::loop_modifies(&i as *const _)] while i < 20 { i = i + 1; }
} Reference: Similar to RawPtr, but we also can use it to replace __CPROVER_object_whole(ptr-expr), Example #[kani::proof]
fn main() { let mut i = 0; let mut a: [u8; 20] = kani::any(); #[kani::loop_invariant(i <= 20)] #[kani::loop_modifies(&i, &a)] while i < 20 { a[i] = 1; i = i + 1; }
} FatPtr (Slice): We use this to replace __CPROVER_object_from(ptr-expr), and __CPROVER_object_upto(ptr-expr, uint-expr). #[kani::proof]
fn main() { let mut i = 3; let mut a: [u8; 100] = kani::any(); #[kani::loop_invariant(i >=3 && i <= 20)] #[kani::loop_modifies(&i , &a[3..20])] while i < 20 { a[i] = 1; i = i + 1; }
} or use std::ptr::slice_from_raw_parts;
#[kani::proof]
fn main() { let mut i = 0; let mut a: [u8; 100] = kani::any(); #[kani::loop_invariant(i <= 20)] #[kani::loop_modifies(&i , slice_from_raw_parts(a.as_ptr(), 20))] while i < 20 { a[i] = 1; i = i + 1; }
}

